      height="14.9"
      viewBox="0 0 14.246 14.9"
    >
      <path
        id="redo-2"
        data-name="redo"
        d="M13.146,11.05l-.174-1.992,2.375-.208a5,5,0,1,0,.819,6.173l2,.5a7,7,0,1,1-1.315-8l-.245-2.8L18.6,4.55l.523,5.977Z"
        transform="translate(-4.877 -4.55)"
      />
    </svg>
  );
};

export default Redo;
